import './App.css';
import { useState } from 'react';
import { Landing } from './Landing-page/Landing-page.js';
import { UploadDownload } from './Upload-Download-page/Upload-Download-page.js';

function App() {

  const [ready, setReady] = useState(false)
  const upload = Landing.upload;
  const codesubmit = Landing.codesubmit;

  function flipwebsites() {

    (upload || codesubmit) ? (
        setReady(true)
      ):(
        setReady(false)
        )
  }


  return (
    <div>
      (upload || codesubmit) ? (
        setReady(true)
      ):(
        setReady(false)
        )
      {
        ready ? (
          <UploadDownload/>
        ) : (
          <Landing/>
          )
      }
    </div>
  );
}

export default App;
